import { MdFastfood } from "react-icons/md";
import HeaderImage from "./HeaderImage";
import styles from "./Header.module.css";

const Header = () => {
  return (
    <>
      <header className={styles.header}>
        <div>
          Foodeli <MdFastfood />
        </div>
        <div className={styles["cart-button"]}>
          <button>Cart</button>
        </div>
      </header>
      <div>
        <HeaderImage />
      </div>
    </>
  );
};

export default Header;
